DROP TABLE IF EXISTS user;
DROP TABLE IF EXISTS properties;
DROP TABLE IF EXISTS currentProperties;
DROP TABLE IF EXISTS formerProperties;
DROP VIEW IF EXISTS soldProperityView;
/* Creates table for user */
CREATE TABLE user (
  userId INTEGER PRIMARY KEY AUTOINCREMENT,
  username TEXT UNIQUE NOT NULL,
  password TEXT NOT NULL,
  email TEXT NOT NULL COLLATE NOCASE,
  firstName TEXT NOT NULL,
  lastName TEXT NOT NULL,
  description TEXT,
  profilePicture TEXT NOT NULL
);
/* Creates table for recommended properties */
DROP TABLE IF EXISTS properties;
CREATE TABLE properties(
   ID             INTEGER  PRIMARY KEY  AUTOINCREMENT NOT NULL
  ,class          VARCHAR(10)
  ,land_value     INTEGER  NOT NULL 
  ,bldg_value     INTEGER  NOT NULL
  ,total_value    INTEGER  NOT NULL
  ,address        VARCHAR(32) NOT NULL
  ,address_city   VARCHAR(15) 
  ,zip_code       INTEGER  NOT NULL
  ,owner          VARCHAR(50) 
  ,school_dist    INTEGER  
  ,land_sq_ft     INTEGER  
  ,year_built     INTEGER  NOT NULL
  ,living_sq_ft   INTEGER  NOT NULL
  ,condition      VARCHAR(12)
  ,residence_type VARCHAR(12) 
  ,building_style VARCHAR(16)
  ,bath           INTEGER  NOT NULL
  ,half_bath      INTEGER 
  ,bedrooms       INTEGER 
  ,basement_beds  INTEGER 
  ,total_beds     INTEGER  NOT NULL
  ,attached_gar   INTEGER  
  ,price          INTEGER  
  ,grade          VARCHAR(6) 
  ,like_dislike   BIT  NOT NULL
  ,userId INTEGER NOT NULL, FOREIGN KEY (userId) REFERENCES user(userId)
);
/* Creates table for owned properties */
CREATE TABLE currentProperties(
   ID             INTEGER  PRIMARY KEY  AUTOINCREMENT NOT NULL
  ,class          VARCHAR(10)
  ,land_value     INTEGER  NOT NULL
  ,bldg_value     INTEGER  NOT NULL
  ,total_value    INTEGER  NOT NULL
  ,address        VARCHAR(32) NOT NULL
  ,address_city   VARCHAR(15) 
  ,zip_code       INTEGER  NOT NULL
  ,owner          VARCHAR(50) 
  ,school_dist    INTEGER  
  ,land_sq_ft     INTEGER  
  ,year_built     INTEGER  NOT NULL
  ,living_sq_ft   INTEGER  NOT NULL
  ,condition      VARCHAR(12)
  ,residence_type VARCHAR(12) 
  ,building_style VARCHAR(16)
  ,bath           INTEGER  NOT NULL
  ,half_bath      INTEGER 
  ,bedrooms       INTEGER 
  ,basement_beds  INTEGER 
  ,total_beds     INTEGER  NOT NULL
  ,attached_gar   INTEGER  
  ,price          INTEGER  
  ,grade          VARCHAR(6) 
  ,like_dislike   BIT  NOT NULL
  ,year_purchased INTEGER
  ,year_sold INTEGER
  ,sold_price INTEGER
  ,renovation_cost INTEGER
  ,userId INTEGER NOT NULL, FOREIGN KEY (userId) REFERENCES user(userId)
);
/* Creates table for sold properties */
CREATE TABLE formerProperties(
   ID             INTEGER  PRIMARY KEY  AUTOINCREMENT NOT NULL
  ,class          VARCHAR(10)
  ,land_value     INTEGER  NOT NULL
  ,bldg_value     INTEGER  NOT NULL
  ,total_value    INTEGER  NOT NULL
  ,address        VARCHAR(32) NOT NULL
  ,address_city   VARCHAR(15)
  ,zip_code       INTEGER  NOT NULL
  ,owner          VARCHAR(50)
  ,school_dist    INTEGER
  ,land_sq_ft     INTEGER
  ,year_built     INTEGER  NOT NULL
  ,living_sq_ft   INTEGER  NOT NULL
  ,condition      VARCHAR(12)
  ,residence_type VARCHAR(12)
  ,building_style VARCHAR(16)
  ,bath           INTEGER  NOT NULL
  ,half_bath      INTEGER
  ,bedrooms       INTEGER
  ,basement_beds  INTEGER
  ,total_beds     INTEGER  NOT NULL
  ,attached_gar   INTEGER
  ,price          INTEGER
  ,grade          VARCHAR(6)
  ,like_dislike   BIT  NOT NULL
  ,year_purchased INTEGER NOT NULL
  ,year_sold INTEGER NOT NULL
  ,sold_price INTEGER NOT NULL
  ,renovation_cost INTEGER NOT NULL
  ,userId INTEGER NOT NULL, FOREIGN KEY (userId) REFERENCES user(userId)
);

CREATE VIEW soldProperityView AS select * From formerProperties;

/* This automatically adds new properties to the model when added to the previous owned table */
CREATE TRIGGER addFormerPropertyToModel AFTER INSERT on currentProperties

BEGIN

INSERT INTO properties(class,land_value,bldg_value,total_value,address,address_city,zip_code,owner,school_dist,land_sq_ft,year_built,
living_sq_ft,condition,residence_type,building_style,bath,half_bath,bedrooms,basement_beds,total_beds,attached_gar,price,grade,like_dislike,userID) 
VALUES (NEW.class, NEW.land_value, NEW.bldg_value, NEW.total_value, NEW.address, NEW.address_city, NEW.zip_code, NEW.owner, NEW.school_dist, NEW.land_sq_ft, 
NEW.year_built, NEW.living_sq_ft, NEW.condition, NEW.residence_type, NEW.building_style, NEW.bath, NEW.half_bath, NEW.bedrooms,
NEW.basement_beds, NEW.total_beds, NEW.attached_gar, NEW.price, NEW.grade, NEW.like_dislike, NEW.userId);

END;

/* This automatically adds new properties to the soldProperty database after user update the information to be sold */
CREATE TRIGGER addToSoldDatabase AFTER UPDATE on currentProperties

BEGIN

INSERT INTO formerProperties(class,land_value,bldg_value,total_value,address,address_city,zip_code,owner,school_dist,land_sq_ft,year_built,
living_sq_ft,condition,residence_type,building_style,bath,half_bath,bedrooms,basement_beds,total_beds,attached_gar,price,grade,like_dislike,year_purchased, year_sold, sold_price, renovation_cost, userID)
VALUES (NEW.class, NEW.land_value, NEW.bldg_value, NEW.total_value, NEW.address, NEW.address_city, NEW.zip_code, NEW.owner, NEW.school_dist, NEW.land_sq_ft,
NEW.year_built, NEW.living_sq_ft, NEW.condition, NEW.residence_type, NEW.building_style, NEW.bath, NEW.half_bath, NEW.bedrooms,
NEW.basement_beds, NEW.total_beds, NEW.attached_gar, NEW.price, NEW.grade, NEW.like_dislike, NEW.year_purchased, NEW.year_sold, NEW.sold_price, NEW.renovation_cost, NEW.userId);

END;


/* When a user deletes a previously owned property, this will also delete it from the model */
CREATE TRIGGER deleteFormerPropertyInModel AFTER DELETE on currentProperties

BEGIN

DELETE FROM properties WHERE address = OLD.address AND zip_code = OLD.zip_code AND userId = OLD.userId;

END;


